column8:
大切なあの人のお誕生日に！<br>いつもと違う数字のローソクで<br>ケーキをかわいく飾りませんか？<br><br>こちらは【0】のローソク♪<style type="text/css">
<!--

span.catch_copy,
span.item_name {
  line-height: 180%;
}

/* 商品名下に境界線が入る */
span.item_name {
    display: block;
    border-bottom: 2px dotted #ddd;
    margin-bottom: -35px;
}

/* 価格に枠線がつく */
table#rakutenLimitedId_cart {
    background-color: #f8f8f8;
    border: 1px solid #ddd;
    padding: 8px;
    margin: 16px 0;
}

span.price1 {
    color: #333 !important;
    font-weight: bold;
    font-size: 80% !important;
    line-height: 30px;
    display: inline-block;
    margin-right: 16px;
}

-->

/* マウスオーバーで画像リンクが変化 */
<!-- 
a:hover {
opacity:0.8;
filter:alpha(opacity=80);
-ms-filter: "alpha( opacity=80 )";
}
-->

<!--
img {
border:0;
}
-->

  <!--
        #rakutenLimitedId_aroundCart input[value="買い物かごに入れる"] {
        background: url("http://image.rakuten.co.jp/kasinoki/cabinet/toppage/sozai_cart.jpg") left top no-repeat;
        width: 240px; /*幅*/
        height: 50px; /*高さ*/
        text-indent: 100%;
        white-space: nowrap;
        overflow: hidden;
        border: none;
        padding: 0;
        margin-top: 5px 0;
        cursor: pointer;
        }
  -->


</style>

<!--上部に貼り付けて使用-->



<!--隠すのはここまで-->

