span.catch_copy:before {
    content: "ただいまポイント10倍中"; /*ラベル内の文言*/
    width: 150px; /*ラベルのサイズ*/
    background-color: #bf0000; /*ラベルの色*/
    font-size: 12px;
    color: #fff;
    text-align: center;
    display: block;
    padding: 1px 4px;
    margin-bottom: 4px;
    border-radius: 6px;
    clear: both;
}
-->


